import React, { useState } from 'react'
import {AiOutlineEye, AiOutlineEyeInvisible} from "react-icons/ai";
import toast from 'react-hot-toast';
import { useNavigate } from 'react-router-dom';

const SignupForm = ({setIsLoggedIn}) => {
    const navigate = useNavigate();

    const [formData, setFormData] = useState({
        firstName:"",
        lastName:"",
        email:"",
        password:"",
        confirmPassword:""
    })

     const [showPassword, setShowPassword] = useState(false);
     const [showConfirmPassword, setShowConfirmPassword] = useState(false);
     const [accountType, setaccountType] = useState("student");
 
    function changeHandler(event) {
        setFormData( (prevData) => (
            {
                ...prevData,
                [event.target.name]:event.target.value
            }
        ))
    }

    function submitHandler(event) {
        event.preventDefault();
        if(formData.password !== formData.confirmPassword) {
            toast.error("Passwords do not match");
            return;
        }
    

     setIsLoggedIn(true);
     toast.success("Account Created");
     const accountData = {
        ...formData
     };


    const finalData = {
        ...accountData,
        accountType
    }


     console.log("Printing Final account data");
     console.log(finalData);

    navigate("/dashboard");

    }
  return (
    <div>
        {/* student-Instructor tab */}
        
        <div  className='flex bg-blue p-1 my-2 gap-x-1  over'>
            <form onSubmit={submitHandler}>


            <button 
            className={`${accountType === "student" 
            ? 
                "bg-[#0C799B]"
            :"bg-transparent text-black font-medium"} py-2 px-5 rounded-full transition-all duration-200`}
            onClick={() => setaccountType("student")}>      
                Student
            </button>


            <button
             className={`${accountType === "instructor" 
            ? 
                "bg-[#0C799B]"
            :"bg-transparent text-black font-medium"} py-2 px-5  rounded-full transition-all duration-200`}
            onClick={() => setaccountType("instructor")}> 
                Instructor
            </button>


            {/* first name and last name  */}
            <div className='flex gap-x-4 mt-[20px]'>

                <label className='w-full'>
                    <p className='text-[0.875rem] text-black mb-1 leading-[1.375rem]'>First Name<sup className='text-pink-200'>*</sup></p>
                    <input
                    required
                    type="text"
                    name="firstName"
                    onChange={changeHandler}
                    placeholder="First Name"
                    value={formData.firstName}
                    className='rounded-[0.5rem] text-black w-full p-[12px] border-[#0C799B] border-2'

                    />
                </label>

                <label className='w-full'>
                    <p className='text-[0.875rem] text-black mb-1 leading-[1.375rem]'>Last Name<sup className='text-pink-200'>*</sup></p>
                    <input
                    required
                    type="text"
                    name="lastName"
                    onChange={changeHandler}
                    placeholder="Last Name"
                    value={formData.lastname}
                    className='rounded-[0.5rem] text-black w-full p-[12px] border-[#0C799B] border-2'

                    />
                </label>
            </div>

            {/* Email Address  */}
            <div className='mt-[20px]'>

            </div>
                <label className='w-full mt-[20px]'>
                    <p className='text-[0.875rem] text-black mb-1 leading-[1.375rem]' >Email Address<sup className='text-pink-200'>*</sup></p>
                    <input
                    required
                    type="email"
                    name="email"
                    onChange={changeHandler}
                    placeholder="Email Address"
                    value={formData.email}
                    className= 'rounded-[0.5rem] text-black w-full p-[12px] border-[#0C799B] border-2'


                    />
                </label>

            {/* create password and Confirm Password  */}
            <div className='w-full flex gap-x-4 mt-[20px]'>
            <label className='w-full relative'>
                    <p className='text-[0.875rem] text-black mb-1 leading-[1.375rem]'>Create Password<sup className='text-pink-200'>*</sup></p>
                    <input
                    required
                    type={showPassword ? ("text") : ("password")}
                    name="password"
                    onChange={changeHandler}
                    placeholder="password"
                    value={formData.password}
                    className='rounded-[0.5rem] text-black w-full p-[12px] border-[#0C799B] border-2'

                    />
                    <span className='absolute right-3 top-[38px] cursor-pointer'
                     onClick={() => setShowPassword((prev) => !prev)}>
                {showPassword ?

                 (<AiOutlineEyeInvisible fontSize={24} fill='#AFB2BF' />) :  

                  (<AiOutlineEye fontSize={24} fill='#AFB2BF' />)}
            </span>
                </label>

                <label className='w-full relative'>
                    <p  className='text-[0.875rem] text-black mb-1 leading-[1.375rem]'>Confirm Password<sup className='text-pink-200'>*</sup></p>
                    <input
                    required
                    type={showConfirmPassword ? ("text") : ("password")}
                    name="confirmPassword"
                    onChange={changeHandler}
                    placeholder="Confirm Password"
                    value={formData.confirmPassword}
                    className='rounded-[0.5rem] text-black w-full p-[12px] border-[#0C799B] border-2'

                    />
                    <span
                    className='absolute right-3 top-[38px] cursor-pointer' 
                    onClick={() => setShowConfirmPassword((prev) => !prev)}>
                {showConfirmPassword ?

                 (<AiOutlineEyeInvisible fontSize={24} fill='#AFB2BF'/>) : 

                 (<AiOutlineEye fontSize={24} fill='#AFB2BF'/>)}
            </span>
                </label>


            </div>
  
         <button className=' w-full bg-[#0C799B] border-2 rounded-[8px] font-medium text-richblack-900 px-[12px] py-[8px] mt-6'>
            Create Account
         </button>
            </form>
        </div>


    </div>
  )
}

export default SignupForm
